"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[5329],{74421:e=>{e.exports=JSON.parse('{"pluginId":"default","version":"1.0.0","label":"1.0.0","banner":"unmaintained","badge":true,"className":"docs-version-1.0.0","isLast":false,"docsSidebars":{"docs":[{"type":"category","label":"Getting Started","items":[{"type":"link","label":"Welcome","href":"/docs/1.0.0/Welcome","docId":"Welcome"}],"collapsed":true,"collapsible":true}]},"docs":{"3scale/3scale_api_management_admin_account_config":{"id":"3scale/3scale_api_management_admin_account_config","title":"Account Configuration","description":"After logging in for the first time, you can configure your account in Account Settings."},"3scale/3scale_api_management_admin_application_plans":{"id":"3scale/3scale_api_management_admin_application_plans","title":"Application Plans","description":"Every product consists of one or more application plans. An application is always associated with an application plan. ...."},"3scale/3scale_api_management_admin_applications":{"id":"3scale/3scale_api_management_admin_applications","title":"Applications","description":"Applications define the credentials to access your product. An application is always associated with one application plan that determines the access policies. Applications are stored within developer accounts."},"3scale/3scale_api_management_admin_billing_settings":{"id":"3scale/3scale_api_management_admin_billing_settings","title":"Billing Settings","description":"Billing settings are divided into Charging &amp; Gateway and Credit Card Policies , both can be found in Audience/Billing."},"3scale/3scale_api_management_admin_products_backends":{"id":"3scale/3scale_api_management_admin_products_backends","title":"Products and backends","description":"Products: Customer-facing APIs. Products facilitate the creation of strong and simplified offerings for API consumers."},"3scale/3scale_api_management_admin_usage_statistics":{"id":"3scale/3scale_api_management_admin_usage_statistics","title":"Usage Statistics","description":"Generic View"},"3scale/3scale_api_management_intro":{"id":"3scale/3scale_api_management_intro","title":"Introduction","description":"Introduction"},"3scale/3scale_api_management_master_admin_portal":{"id":"3scale/3scale_api_management_master_admin_portal","title":"Master Admin Portal","description":"A master administrator monitors and manages the 3scale accounts through the Master Admin Portal and API endpoints. The Master Admin Portal contains information about all accounts in a deployment and allows for administration of accounts and users through a unique account page."},"3scale/3scale_developer_portal_consume":{"id":"3scale/3scale_developer_portal_consume","title":"Consume APIs as a developer","description":"Register / Subscribe to an API Application plan"},"3scale/3scale_developer_portal_customize":{"id":"3scale/3scale_developer_portal_customize","title":"Customize look and feel","description":"Overview"},"3scale/3scale_publish_ckan_api":{"id":"3scale/3scale_publish_ckan_api","title":"Publish CKAN APIs","description":"Register a CKAN API"},"3scale/3scale_publish_ngsi_api":{"id":"3scale/3scale_publish_ngsi_api","title":"Publish NGSI APIs","description":"Publish an NGSI API in 3Scale"},"3scale/3scale_publish_ogc_web_services":{"id":"3scale/3scale_publish_ogc_web_services","title":"Publish OGC web services","description":"Register an OGC service endpoint"},"3scale/3scale_publish_step_by_step":{"id":"3scale/3scale_publish_step_by_step","title":"Step by step Guide","description":"How to register a new API endpoint:"},"3scale/3scale_video_tutorials":{"id":"3scale/3scale_video_tutorials","title":"Video Tutorials","description":"List of available 3scale API Management tutorials:"},"3scale/apicurio_api_validation":{"id":"3scale/apicurio_api_validation","title":"Validating APIs with Apicurio","description":"There are many ways in which an API can be not fully functional. These include:"},"current-versions":{"id":"current-versions","title":"Product Versions","description":"Dataplatform"},"data-collection/datacollection_eigenproject":{"id":"data-collection/datacollection_eigenproject","title":"Create your own project","description":"Of course our example is just a start. We created this show case purely to show in what way crowdsourcing can be used to create new and interesting open data."},"data-collection/datacollection_hoe":{"id":"data-collection/datacollection_hoe","title":"Farmer shops example","description":"The idea behind our Farmer Shops example is quite simple. We created a form where people can add information about Farmer Shops. Everybody can use the form to add a new Farmer Shop. The idea is to use crowdsourcing to create a bigger and bigger dataset with as many Farmer Shops as possible."},"data-collection/datacollection_introductie":{"id":"data-collection/datacollection_introductie","title":"Data Collection toolkit","description":"Collect your own datasets"},"data-collection/datacollection_stap1":{"id":"data-collection/datacollection_stap1","title":"Connect to our Dataplatform","description":"In our Farmer Shops example, the names of the input fields of our form correspond to the column names in the dataset. After the user submits the form, a new record is added to a CSV file that is stored in the CKAN Datastore on our Dataplatform. In order to insert these new records we make use of the CKAN Datastore API."},"data-collection/datacollection_stap2":{"id":"data-collection/datacollection_stap2","title":"Using the Datastore API","description":"All actions related to inserting, updating, or even deleting records, are done through the CKAN Datastore API."},"data-kookboek/kookboek_data":{"id":"data-kookboek/kookboek_data","title":"Transparantie","description":"In het kader van transparantie kan de eerder genoemde datacatalogus hulp bieden. Een belangrijk onderdeel van de Haagse Datacatalogus zijn de links tussen informatieproducten, zoals BI-rapportages en Dashboards. Bij elk van deze producten kan aangegeven worden welke bronbestanden voor dit product gebruikt zijn. Wanneer een dergelijk informatieproduct gebruikt of gepubliceerd wordt, is direct duidelijk wat de onderliggende bronnen zijn geweest. Het komt in de praktijk voor dat er al nieuwe versies van (bron)bestanden zijn, maar dat die nog niet gebruikt worden in een rapport, dashboard of kaart."},"data-kookboek/kookboek_data_bgt":{"id":"data-kookboek/kookboek_data_bgt","title":"Meetbaar - Voorbeeld dataset - Basisregistratie Grootschalige Topografie (BGT)","description":"Dit is een praktisch voorbeeld waarbij alle stappen van deze nieuwe manier van werken worden bezocht. Alle eerder genoemde onderwerpen zullen in meer of mindere mate aan bod komen met de nadruk op \'wateroverlast\'"},"data-kookboek/kookboek_data_context":{"id":"data-kookboek/kookboek_data_context","title":"Data in context","description":"Zoals in de voorgaande hoofdstukken beschreven is, kunnen metadata, datamodellen en ratings een goed beeld vormen van de kwaliteit van een dataset. Kwalitatief hoogwaardige datasets kunnen dan ook een belangrijke rol spelen bij het monitoren en analyseren van beleid. Data blijft echter uiteindelijk slechts een modelweergave van de werkelijkheid."},"data-kookboek/kookboek_data_knmi":{"id":"data-kookboek/kookboek_data_knmi","title":"Meetbaar - Voorbeeld dataset - KNMI","description":"Dit is een praktisch voorbeeld waarbij alle stappen van deze nieuwe manier van werken worden bezocht. Alle eerder genoemde onderwerpen zullen in meer of mindere mate aan bod komen met de nadruk op \'wateroverlast\'"},"data-kookboek/kookboek_datamodellen":{"id":"data-kookboek/kookboek_datamodellen","title":"Datamodellen","description":"Een datamodel is een abstract model om de onderlinge relatie tussen data-elementen te ordenen en hun verhouding tot kenmerken van de echte wereld weer te geven. Datamodellen gaan over de structuur van de data. Het doel  van een datamodel is dat ze de ontwikkeling van informatiesystemen vereenvoudigen door een definitie van het dataformaat te geven."},"data-kookboek/kookboek_DataOntsluiting":{"id":"data-kookboek/kookboek_DataOntsluiting","title":"Data ontsluiting","description":"De vorige hoofdstukken gingen over het bepalen van de relevantie en kwaliteit van verschillende individuele datasets. Een ander belangrijk onderdeel is het combineren en gebruiken van deze datasets in toepassingen. Hierbij speelt de manier van ontsluiten en beschikbaar maken van deze data een belangrijke rol. Dat kan op een groot aantal manieren."},"data-kookboek/kookboek_example_digitaltwin":{"id":"data-kookboek/kookboek_example_digitaltwin","title":"Voorbeeld toepassing - Digital Twin (3D)","description":"Een Digital Twin is een digitale representatie van een entiteit in de echt wereld"},"data-kookboek/kookboek_example_kam":{"id":"data-kookboek/kookboek_example_kam","title":"Voorbeeld toepassing - Klimaatadaptatie","description":"Klimaatadaptie is een belangrijk onderwerp met de huidige veranderingen in het milieu en de veranderingen die nog gaan komen in de toekomst. Waterverlast hoort daar ook bij, maar denk ook aan hitte-eilanden, energieverbruik en -opwekking en luchtkwaliteit."},"data-kookboek/kookboek_example_smartcity":{"id":"data-kookboek/kookboek_example_smartcity","title":"Voorbeeld toepassing - Smart City","description":"=== work in progress ==="},"data-kookboek/kookboek_example_snuffelfiets":{"id":"data-kookboek/kookboek_example_snuffelfiets","title":"Voorbeeld toepassing - SnuffelFiets","description":"Het snuffelfiets project is een initatief vanuit de provincie Utrecht om samen met burgers door middel van relatief goedkope sensoren een beeld te krijgen van de luchtkwaliteit in de provincie. Vaak is het onduidelijk hoe het nou staat met de luchtkwaliteit in een kwantitatieve manier en zijn de mogelijkheden om dit vast te stellen over het algemeen een flinke investering. Dit is een van veel voorkomende vicieuze cirkels, waarbij data nodig is om het probleem vast te stellen maar het probleem al duidelijk moet zijn om de juiste data te verzamelen."},"data-kookboek/kookboek_example_wateroverlast":{"id":"data-kookboek/kookboek_example_wateroverlast","title":"Evalueerbaar - voorbeeld toepassing - Wateroverlast","description":"Dit is een praktisch voorbeeld waarbij alle stappen van deze nieuwe manier van werken worden bezocht. Alle eerder genoemde onderwerpen zullen in meer of mindere mate aan bod komen met de nadruk op \'wateroverlast\'"},"data-kookboek/kookboek_inleiding":{"id":"data-kookboek/kookboek_inleiding","title":"Inleiding","description":"De provincie Zuid-Holland wil de meetbaarheid, controleerbaarheid en monitoring van haar doelstellingen met betrekking tot de kwaliteit van de leefomgeving verbeteren. Daarbij wil zij beter gebruik maken van de mogelijkheden die data bieden. Dit \\"kookboek\\" beschrijft de onderdelen en stappen die samenhangen met een beter gebruik van data voor het verbeteren van de kwaliteit van de leefomgeving."},"data-kookboek/kookboek_inzicht":{"id":"data-kookboek/kookboek_inzicht","title":"Inzicht verkrijgen","description":"Om tot een meetbaar omgevingsbeleid te komen is data nodig. Maar welke data is relevant? En wat is de kwaliteit? En is data aanwezig?"},"data-kookboek/kookboek_KPI":{"id":"data-kookboek/kookboek_KPI","title":"Kritieke prestatie-indicator (KPI)","description":"Kritieke prestatie-indicatoren  (ook wel kritische in plaats van kritieke), afgekort KPI\'s, zijn variabelen om prestaties te analyseren."},"data-kookboek/kookboek_metadata":{"id":"data-kookboek/kookboek_metadata","title":"Metadata","description":"Een andere belangrijke hulp bij het bepalen van de kwaliteit en mogelijke relevantie van een dataset, is metadata."},"data-kookboek/kookboek_opzet":{"id":"data-kookboek/kookboek_opzet","title":"Data als hulpmiddel","description":"De provincie Zuid-Holland ontwikkelt beleid om gewenste ontwikkelingen/verbeteringen in de fysieke leefomgeving te bereiken. In het beleid wordt rekening gehouden met een groot aantal factoren. De ontwikkeling van die factoren is deels voorspelbaar, deels onvoorspelbaar. Daarom heeft beleid niet altijd de uitkomst of impact die vooraf was bedacht. Data kunnen een hulpmiddel zijn om de onzekerheid van uitkomsten te verminderen. Ze zijn niet het toverstokje dat alle problemen oplost of een maakbare samenleving cre\xebert. Data kunnen gebruikt worden voor het bieden van inzicht en het opstellen van modellen, simulaties en analyses. Daarmee kan een beter beeld worden gegeven van de (mogelijke) implicaties van beleidsmaatregelen. Door maatregelen te monitoren kan de uitvoering gevolgd worden en waar nodig worden bijgesteld."},"data-kookboek/kookboek_rating_datasets":{"id":"data-kookboek/kookboek_rating_datasets","title":"Rating datasets","description":"Naast metadata en datamodellen kunnen ook ratings bijdragen aan de bepaling van de kwaliteit van individuele datasets."},"data-kookboek/kookboek_Standaarden":{"id":"data-kookboek/kookboek_Standaarden","title":"Standaarden","description":"Bij data gaat het ook vaak over het gebruik van standaarden. Die kunnen betrekking hebben op een groot aantal verschillende onderwerpen, zoals woorden (definities), bestandsformaten, meeteenheden en datamodellen."},"data-kookboek/kookboek_wateroverlast":{"id":"data-kookboek/kookboek_wateroverlast","title":"Aanpak - Wateroverlast","description":"Dit is een praktisch voorbeeld waarbij alle stappen van deze nieuwe manier van werken worden bezocht. Alle eerder genoemde onderwerpen zullen in meer of mindere mate aan bod komen met de nadruk op \'wateroverlast\'"},"data-kookboek/kookboek-wateroverlast":{"id":"data-kookboek/kookboek-wateroverlast","title":"Aanpak - Wateroverlast","description":"Dit is een praktisch voorbeeld waarbij alle stappen van deze nieuwe manier van werken worden bezocht. Alle eerder genoemde onderwerpen zullen in meer of mindere mate aan bod komen met de nadruk op \'wateroverlast\'"},"datacatalogus/abonneren":{"id":"datacatalogus/abonneren","title":"Vermeldingen","description":"Abonneren op vermeldingen"},"datacatalogus/activiteitenstroom":{"id":"datacatalogus/activiteitenstroom","title":"Activiteitenstroom","description":"Activiteitenstroom bekijken"},"datacatalogus/api_key":{"id":"datacatalogus/api_key","title":"API key vernieuwen","description":"API key vernieuwen"},"datacatalogus/ckan_api":{"id":"datacatalogus/ckan_api","title":"CKAN API","description":"CKAN API"},"datacatalogus/ckan_groepen":{"id":"datacatalogus/ckan_groepen","title":"Thema\'s als CKAN Groepen","description":"In de Datacatalogus wordt gebruik gemaakt van Thema\u2019s om vermeldingen te categoriseren."},"datacatalogus/ckan_stats":{"id":"datacatalogus/ckan_stats","title":"CKAN statistieken","description":"Het is mogelijk om op CKAN een beknopt overzicht met statistieken op te vragen. Dit kan door naar /stats te gaan. Documentatie voor ontwikkelaars is te vinden op de officiele CKAN docs pagina//docs.ckan.org/en/latest/maintaining/stats.html."},"datacatalogus/data_dictionary":{"id":"datacatalogus/data_dictionary","title":"Data Dictionary","description":"Data Dictionary"},"datacatalogus/data_officers":{"id":"datacatalogus/data_officers","title":"Data officers","description":"Data Officers"},"datacatalogus/definitie_module":{"id":"datacatalogus/definitie_module","title":"De Definitie module","description":"De Definitie module"},"datacatalogus/definities_toevoegen":{"id":"datacatalogus/definities_toevoegen","title":"Definities toevoegen aan vermeldingen","description":"Definities toevoegen aan vermeldingen"},"datacatalogus/dienst_toevoegen":{"id":"datacatalogus/dienst_toevoegen","title":"Een dienst toevoegen","description":"CKAN Diensten worden gebruikt om collecties van vermeldingen te maken, beheren en publiceren. Gebruikers kunnen meerdere rollen hebben binnen een dienst, afhankelijk van een autorisatielevel om toe te voegen, wijzigen en publiceren."},"datacatalogus/dienst_verwijderen":{"id":"datacatalogus/dienst_verwijderen","title":"Een dienst verwijderen","description":"Een dienst verwijderen"},"datacatalogus/doel":{"id":"datacatalogus/doel","title":"Introductie","description":"Doel van deze documentatie"},"datacatalogus/filteren":{"id":"datacatalogus/filteren","title":"Filteren","description":"Filteren"},"datacatalogus/koppelen":{"id":"datacatalogus/koppelen","title":"Koppeling metadata en thema\'s","description":"Koppeling metadata en thema\u2019s"},"datacatalogus/korte_intro":{"id":"datacatalogus/korte_intro","title":"Introductie","description":"Datacatalogus \u2013 een korte introductie"},"datacatalogus/linken":{"id":"datacatalogus/linken","title":"Vermeldingen","description":"Gelinkte vermeldingen"},"datacatalogus/matomo":{"id":"datacatalogus/matomo","title":"Matomo","description":"Meer uitgebreide statistieken kunnen bekeken worden via Matomo (open-source variant op Google Analytics). Matomo kan naar eigen wens worden ingericht:"},"datacatalogus/meerdere_toewijzen":{"id":"datacatalogus/meerdere_toewijzen","title":"Meerdere thema\'s toewijzen","description":"Meerdere thema\u2019s toewijzen"},"datacatalogus/notificaties":{"id":"datacatalogus/notificaties","title":"Notificaties","description":"Notificatiemodule"},"datacatalogus/Rotterdam":{"id":"datacatalogus/Rotterdam","title":"What is Data Validation","description":"Data Validation"},"datacatalogus/standaard_gebruikers":{"id":"datacatalogus/standaard_gebruikers","title":"Standaard gebruikers","description":"Standaard gebruikers"},"datacatalogus/systeembeheerder":{"id":"datacatalogus/systeembeheerder","title":"Systeembeheerder","description":"Gebruikers kunnen verschillende rollen en rechten hebben binnen de Datacatalogus."},"datacatalogus/toevoegen":{"id":"datacatalogus/toevoegen","title":"Wat zijn Vermeldingen?","description":"Zoals eerder vermeld, is Datacatalogus gebouwd in CKAN. Hiermee kan data worden georganiseerd, gepubliceerd en gezocht of gevonden."},"datacatalogus/toevoegen_harvest":{"id":"datacatalogus/toevoegen_harvest","title":"Vermeldingen toevoegen - Harvesten","description":"Naast het toevoegen van vermeldingen en databronnen via de normale CKAN user interface, is het ook mogelijk om vermeldingen en data te harvesten van andere bronsystemen."},"datacatalogus/toevoegen_overig":{"id":"datacatalogus/toevoegen_overig","title":"Vermeldingen toevoegen","description":"Opties om vermelding toe te voegen"},"datacatalogus/toewijzen":{"id":"datacatalogus/toewijzen","title":"Een thema toewijzen aan een vermelding","description":"Een thema toewijzen aan een vermelding"},"datacatalogus/vermeldingen_dienst":{"id":"datacatalogus/vermeldingen_dienst","title":"Vermeldingen van verwijderde dienst","description":"Wat gebeurt er met vermeldingen die in een verwijderde dienst stonden?"},"datacatalogus/verplichte_metadatavelden":{"id":"datacatalogus/verplichte_metadatavelden","title":"Verplichte metadatavelden","description":"Binnenkort zal een nieuw metadataschema worden toegevoegd aan Datacatalogus. Dit schema zal gebaseerd zijn op DCAT-AP-DONL-1.1, DCAT-SE en ISO 19115."},"datacatalogus/verwijderen":{"id":"datacatalogus/verwijderen","title":"Vermeldingen","description":"Een vermelding verwijderen"},"datacatalogus/wachtwoord_veranderen":{"id":"datacatalogus/wachtwoord_veranderen","title":"Wachtwoord veranderen","description":"Door helemaal bovenaan de pagina op je gebruikersnaam te klikken kom je op je persoonlijke profielpagina terecht. Hier kun je onder meer je API key vinden en je activiteitenstroom bekijken."},"datacatalogus/workflow":{"id":"datacatalogus/workflow","title":"Workflow","description":"Workflow Datacatalogus"},"datacatalogus/zoeken":{"id":"datacatalogus/zoeken","title":"Zoeken in Datacatalogus","description":"Datacatalogus biedt uitgebreide mogelijkheden om naar data en informatie te zoeken, zoals via trefwoorden, beschrijving, organisatieonderdeel, thema of definities. Door de dwarsverbanden en koppelingen ontstaat er een beter beeld van de samenhang tussen alle bronnen en producten."},"dataplatform/ckan_Overview":{"id":"dataplatform/ckan_Overview","title":"Overview","description":"Here you will find an overview of what CKAN is, in addition to what you can accomplish with CKAN."},"dataplatform/dataoverheid_LinkToDataOverheid":{"id":"dataplatform/dataoverheid_LinkToDataOverheid","title":"Link To Data Overheid","description":"The link to Data Overheid is the service that allows datasets in Dataplatform to be synched with Data Overheid."},"dataplatform/dataplatform_Introduction":{"id":"dataplatform/dataplatform_Introduction","title":"Introduction","description":"Dataplatform is comprised of two solutions, the Portal and CKAN."},"dataplatform/datasets_AddingDatasets":{"id":"dataplatform/datasets_AddingDatasets","title":"Adding Datasets","description":"Adding a dataset represents the first step in adding a new data entry. The second step is adding a datasource"},"dataplatform/datasets_AddingDatasources":{"id":"dataplatform/datasets_AddingDatasources","title":"Adding Datasources","description":"All sources are stored within a dataset."},"dataplatform/datasets_DataDictionary":{"id":"dataplatform/datasets_DataDictionary","title":"Data Dictionary","description":"The Data Dictionary is a module that, for specific file types, automatically detects column names and data types used within these specific columns."},"dataplatform/datasets_DeletingDatasets":{"id":"dataplatform/datasets_DeletingDatasets","title":"Deleting Datasets","description":"If you wish to permanently delete your dataset, please contact the administrator"},"dataplatform/datasets_DownloadingDatasets":{"id":"dataplatform/datasets_DownloadingDatasets","title":"Downloading Datasets","description":"This is where we talk about downloading data/datasets"},"dataplatform/datasets_EditingDatasets":{"id":"dataplatform/datasets_EditingDatasets","title":"Editing Datasets","description":"Depending on your privileges, you may edit datasets that you have created yourself and/or datasets owned by your organization. Members may not edit datasets."},"dataplatform/datasets_ManageGeometryColumns":{"id":"dataplatform/datasets_ManageGeometryColumns","title":"Manage Geometry Columns","description":"When a file containing geometry is uploaded in CKAN there is a chance that the geometry columns included don\u2019t comply with the default field naming (such as lat, latitude, lon, longitude, x, y). This causes the geo-data to not be handled correctly and the visualization to be impossible."},"dataplatform/datasets_PreviewDatasources":{"id":"dataplatform/datasets_PreviewDatasources","title":"Preview Datasources","description":"The CKAN resource page can contain one or more visualizations of the resource data or file contents (a table, a bar chart, a map, etc). These are commonly referred to as resource views."},"dataplatform/datasets_SearchDatasets":{"id":"dataplatform/datasets_SearchDatasets","title":"Searching Datasets","description":"Searching allows you to quickly find relevant information for datasets, organizations, theme, and groups. You do not need to be logged in to saerch. Searching for datasets can be conducted via the searchbar on the front page, in addition to the searchbar on the dataset page; popular tags are displayed underneath the search bar."},"dataplatform/datasets_SortFilterDatasets":{"id":"dataplatform/datasets_SortFilterDatasets","title":"Sorting and Filtering Datasets","description":"Sorting allows you to reorder datasets in different ways."},"dataplatform/datasets_SortingDatasets":{"id":"dataplatform/datasets_SortingDatasets","title":"Sorting Datasets","description":"Sorting allows you to reorder datasets in different ways."},"dataplatform/datasets_xls2csv":{"id":"dataplatform/datasets_xls2csv","title":"Generate CSV from XLS resource","description":"When a user wants to upload an xls resource inside a dataset, she now has the ability to convert it into a csv format."},"dataplatform/developers_CKANApi":{"id":"dataplatform/developers_CKANApi","title":"CKAN Api","description":"This is where we talk about CKAN\'s API."},"dataplatform/developers_Visualisation":{"id":"dataplatform/developers_Visualisation","title":"Using Visualisation Tools","description":"Creating Maps Using QGIS"},"dataplatform/geoserver_GeoserverIntegration":{"id":"dataplatform/geoserver_GeoserverIntegration","title":"Geoserver Integration","description":"This version of ckanext-geoserver plugin currently supports publishing of a single resource/file inside a dataset. The option of selecting a specific resource to publish is not yet implemented. At the moment, the script automatically recognizes the only resource available and provides all the information needed to be published. If there is more than one resource inside the dataset, and the user tries to publish them, even though the pop up window may load with the correct options, the publishing process will fail."},"dataplatform/harvesting_GettingStarted":{"id":"dataplatform/harvesting_GettingStarted","title":"Getting Started","description":"Note: This tutorial assumes background knowledge of what type of sources are compliant with the three harvester options in CKAN"},"dataplatform/harvesting_Harvesting":{"id":"dataplatform/harvesting_Harvesting","title":"Harvesting","description":"What is a Data Harvester?"},"dataplatform/metadata_DCAT":{"id":"dataplatform/metadata_DCAT","title":"DCAT","description":"Every dataset contains metadata. For open data we follow the guidelines set in the DCAT-Standard."},"dataplatform/metadata_Metadata":{"id":"dataplatform/metadata_Metadata","title":"Metadata","description":"Metadata is simply data about data"},"dataplatform/metadata_Schema\'s":{"id":"dataplatform/metadata_Schema\'s","title":"Schemes","description":"Metadata can be written in many different ways, and every country has their own metadata definition, following the DCAT Standard. Datacatalogue has unique metadata for every data product."},"dataplatform/portal_Overview":{"id":"dataplatform/portal_Overview","title":"Overview","description":"The Portal offers a homepage where you can highlight your goals, showcases and stories. There is a separate page with all the datasets, presented as cards. Through the filter and search options userscan easily navigate to a dataset. The data can also be arranged according to the theme\'s or organisations/departments."},"dataplatform/user_AddingUsers":{"id":"dataplatform/user_AddingUsers","title":"Adding Users","description":"Only organization administrators may create new users"},"dataplatform/user_DeletingUsers":{"id":"dataplatform/user_DeletingUsers","title":"Deleting Users","description":"Administrators may delete users who are members of their organization"},"dataplatform/user_EditingUsers":{"id":"dataplatform/user_EditingUsers","title":"Editing Users","description":"Only administrators may change user\'s roles"},"dataplatform/user_KeycloakIntegration":{"id":"dataplatform/user_KeycloakIntegration","title":"Keycloak Integration","description":"More information about Keycloak may be found here"},"dataplatform/user_LoginDashboard":{"id":"dataplatform/user_LoginDashboard","title":"Login and Dashboard","description":"In order to add, edit or delete datasets, you need be logged in. Your login permissions are based configured at the organization-level; you have the possibility to be a member in one or more organizations. This allows you to manage multiple datasets across different organizations. Each organization also contains different user permission levels; roles."},"dataplatform/user_PersonalProfile":{"id":"dataplatform/user_PersonalProfile","title":"Personal Profile","description":"Your user profile contains imformation about your personal and account details; you can only see your user profile while you\'re logged in"},"dataplatform/user_UserRoles":{"id":"dataplatform/user_UserRoles","title":"User Roles","description":"You must be logged in to add, edit, or delete datasets."},"dataplatform/validation_GettingStarted":{"id":"dataplatform/validation_GettingStarted","title":"Getting Started","description":"This page will get you started with validating your data."},"dataplatform/validation_WhatIsDataValidation":{"id":"dataplatform/validation_WhatIsDataValidation","title":"What is Data Validation","description":"Data Validation"},"metamorphoses/metamorphoses_aanleiding":{"id":"metamorphoses/metamorphoses_aanleiding","title":"Aanleiding","description":"De provincie Zuid-Holland heeft, net als elke provincie, een leefomgevingstest gedaan. Daarover heeft zij een rapport ontvangen van Commissie MER, waarin is aangegeven dat de meetbaarheid, controleerbaarheid en evaluatie van haar doelstellingen verbeterd dient te worden. Dit heeft een sterke relatie met de wijze waarop data worden gebruikt (kwaliteit, actualiteit, samenhang etc.)."},"metamorphoses/metamorphoses_conclusie":{"id":"metamorphoses/metamorphoses_conclusie","title":"Tot slot","description":"Dit gestructureerde, praktische en resultaatgericht datagedreven proces is bedoeld als een herbruikbaar proces en kun je op elk onderwerp toepassen."},"metamorphoses/metamorphoses_data":{"id":"metamorphoses/metamorphoses_data","title":"Transparantie","description":"In het kader van transparantie kan de eerder genoemde datacatalogus hulp bieden. Een belangrijk onderdeel van de Haagse Datacatalogus zijn de links tussen informatieproducten, zoals BI-rapportages en Dashboards. Bij elk van deze producten kan aangegeven worden welke bronbestanden voor dit product gebruikt zijn. Wanneer een dergelijk informatieproduct gebruikt of gepubliceerd wordt, is direct duidelijk wat de onderliggende bronnen zijn geweest. Het komt in de praktijk voor dat er al nieuwe versies van (bron)bestanden zijn, maar dat die nog niet gebruikt worden in een rapport, dashboard of kaart."},"metamorphoses/metamorphoses_data_bgt":{"id":"metamorphoses/metamorphoses_data_bgt","title":"Meetbaar - Voorbeeld dataset - Basisregistratie Grootschalige Topografie (BGT)","description":"Dit is een praktisch voorbeeld waarbij alle stappen van deze nieuwe manier van werken worden bezocht. Alle eerder genoemde onderwerpen zullen in meer of mindere mate aan bod komen met de nadruk op \'wateroverlast\'"},"metamorphoses/metamorphoses_data_context":{"id":"metamorphoses/metamorphoses_data_context","title":"Data in context","description":"Zoals in de voorgaande hoofdstukken beschreven is, kunnen metadata, datamodellen en ratings een goed beeld vormen van de kwaliteit van een dataset. Kwalitatief hoogwaardige datasets kunnen dan ook een belangrijke rol spelen bij het monitoren en analyseren van beleid. Data blijft echter uiteindelijk slechts een modelweergave van de werkelijkheid."},"metamorphoses/metamorphoses_data_knmi":{"id":"metamorphoses/metamorphoses_data_knmi","title":"Meetbaar - Voorbeeld dataset - KNMI","description":"Dit is een praktisch voorbeeld waarbij alle stappen van deze nieuwe manier van werken worden bezocht. Alle eerder genoemde onderwerpen zullen in meer of mindere mate aan bod komen met de nadruk op \'wateroverlast\'"},"metamorphoses/metamorphoses_data_ontsluiting":{"id":"metamorphoses/metamorphoses_data_ontsluiting","title":"Data ontsluiting","description":"De vorige hoofdstukken gingen over het bepalen van de relevantie en kwaliteit van verschillende individuele datasets. Een ander belangrijk onderdeel is het combineren en gebruiken van deze datasets in toepassingen. Hierbij speelt de manier van ontsluiten en beschikbaar maken van deze data een belangrijke rol. Dat kan op een groot aantal manieren."},"metamorphoses/metamorphoses_datamodellen":{"id":"metamorphoses/metamorphoses_datamodellen","title":"Datamodellen","description":"Een datamodel is een abstract model om de onderlinge relatie tussen data-elementen te ordenen en hun verhouding tot kenmerken van de echte wereld weer te geven. Datamodellen gaan over de structuur van de data. Het doel  van een datamodel is dat ze de ontwikkeling van informatiesystemen vereenvoudigen door een definitie van het dataformaat te geven."},"metamorphoses/metamorphoses_gebruiksaanwijzing":{"id":"metamorphoses/metamorphoses_gebruiksaanwijzing","title":"Gebruiksaanwijzing","description":"Dit stappenplan bevat verschillende bouwstenen die ieder ingaan op een aspect rondom de meetbaarheid, controleerbaarheid en monitoring/evaluatie van data."},"metamorphoses/metamorphoses_introductie":{"id":"metamorphoses/metamorphoses_introductie","title":"Introductie","description":"De provincie Zuid-Holland wil de meetbaarheid, controleerbaarheid en monitoring van haar doelstellingen met betrekking tot de kwaliteit van de leefomgeving verbeteren. Daarbij wil zij beter gebruik maken van de mogelijkheden die data bieden. Dit document doorloopt de verschillende onderdelen die samenhangen met een beter gebruik van data voor het verbeteren van de kwaliteit van de leefomgeving."},"metamorphoses/metamorphoses_inzet":{"id":"metamorphoses/metamorphoses_inzet","title":"Hoe zetten we data effectief in?","description":"Data kunnen een hulpmiddel zijn om de onzekerheid van uitkomsten te verminderen. Ze zijn niet het toverstokje dat alle problemen oplost of een maakbare samenleving cre\xebert."},"metamorphoses/metamorphoses_KPI":{"id":"metamorphoses/metamorphoses_KPI","title":"Kritieke prestatie-indicator (KPI)","description":"Kritieke prestatie-indicatoren  (ook wel kritische in plaats van kritieke), afgekort KPI\'s, zijn variabelen om prestaties te analyseren."},"metamorphoses/metamorphoses_metadata":{"id":"metamorphoses/metamorphoses_metadata","title":"Metadata","description":"Een andere belangrijke hulp bij het bepalen van de kwaliteit en mogelijke relevantie van een dataset, is metadata."},"metamorphoses/metamorphoses_opzet":{"id":"metamorphoses/metamorphoses_opzet","title":"Data als hulpmiddel","description":"De provincie Zuid-Holland ontwikkelt beleid om gewenste ontwikkelingen/verbeteringen in de fysieke leefomgeving te bereiken. In het beleid wordt rekening gehouden met een groot aantal factoren. De ontwikkeling van die factoren is deels voorspelbaar, deels onvoorspelbaar. Daarom heeft beleid niet altijd de uitkomst of impact die vooraf was bedacht. Data kunnen een hulpmiddel zijn om de onzekerheid van uitkomsten te verminderen. Ze zijn niet het toverstokje dat alle problemen oplost of een maakbare samenleving cre\xebert. Data kunnen gebruikt worden voor het bieden van inzicht en het opstellen van modellen, simulaties en analyses. Daarmee kan een beter beeld worden gegeven van de (mogelijke) implicaties van beleidsmaatregelen. Door maatregelen te monitoren kan de uitvoering gevolgd worden en waar nodig worden bijgesteld."},"metamorphoses/metamorphoses_rating_datasets":{"id":"metamorphoses/metamorphoses_rating_datasets","title":"Rating datasets","description":"Naast metadata en datamodellen kunnen ook ratings bijdragen aan de bepaling van de kwaliteit van individuele datasets."},"metamorphoses/metamorphoses_stap_1":{"id":"metamorphoses/metamorphoses_stap_1","title":"Stap 1 - Maak het vraagstuk concreet","description":"Veel vraagstukken zijn dusdanig complex dat concretisering nodig is om tot een antwoord te kunnen komen. Om een vraagstuk te concretiseren is het belangrijk om de juiste vragen te stellen."},"metamorphoses/metamorphoses_stap_10":{"id":"metamorphoses/metamorphoses_stap_10","title":"Stap 10 - Presenteer","description":"Maak een rapport/dashboard/presentatie. Betrek collega\u2019s, stakeholders en anderen uit je ecosysteem bij de inzichten die je hebt opgedaan."},"metamorphoses/metamorphoses_stap_11":{"id":"metamorphoses/metamorphoses_stap_11","title":"Stap 11 - Evalueer","description":"Bekijk het rapport/dashboard/presentatie en bespreek de trend die uit de data blijkt. Op basis hiervan kun je weer verder bouwen, de aanpak aanscherpen, veranderen."},"metamorphoses/metamorphoses_stap_2":{"id":"metamorphoses/metamorphoses_stap_2","title":"Stap 2 - Formuleer indicatoren, maak beleid meetbaar","description":"Vertaal de sleutelelementen in 1 of meerdere meetbare indicatoren."},"metamorphoses/metamorphoses_stap_3":{"id":"metamorphoses/metamorphoses_stap_3","title":"Stap 3 - Verzamel of cre\xeber data","description":"Hoewel bij het verzamelen van de gewenste databronnen vaak eerst binnen de eigen organisatie wordt gekeken, kan het juist ook interessant zijn om gebruik te maken van externe (open) databronnen"},"metamorphoses/metamorphoses_stap_4":{"id":"metamorphoses/metamorphoses_stap_4","title":"Stap 4 - Waardeer deze data","description":"Er is zeer veel data beschikbaar. Hoe je deze data waardeert, is een heel andere vraag. Op voorhand is de inhoud, kwaliteit, relevantie of bruikbaarheid niet altijd duidelijk. Een goed fundament voor datagedreven beleid begint daarom met het cre\xebren van inzicht in deze aspecten. Het maakt data meetbaar, waardoor beleid controleerbaar en analyseerbaar kan worden en dus transparant."},"metamorphoses/metamorphoses_stap_5":{"id":"metamorphoses/metamorphoses_stap_5","title":"Stap 5 - Prepareren van data","description":"Naast het bepalen van de inhoudelijke kwaliteit van de data, is het belangrijk om ook naar de databron zelf te kijken. Zo kan het mogelijk zijn dat de databron zelf nog aanpassingen nodig heeft voordat de databron gebruikt kan worden voor analyse."},"metamorphoses/metamorphoses_stap_6":{"id":"metamorphoses/metamorphoses_stap_6","title":"Stap 6 - Combineren van databronnen","description":"Soms is \xe9\xe9n databron niet voldoende om een vraagstuk te beantwoorden en is het nodig om verschillende databronnen te combineren of samen te voegen om tot conclusies te kunnen komen."},"metamorphoses/metamorphoses_stap_7":{"id":"metamorphoses/metamorphoses_stap_7","title":"Stap 7 - Verwerken van data","description":"Na het prepareren en eventueel combineren van de gevonden databronnen, is de volgende stap het verwerken van de data. Dit wil zeggen de feitelijke analyse van de data om KPI\'s te kunnen bepalen."},"metamorphoses/metamorphoses_stap_8":{"id":"metamorphoses/metamorphoses_stap_8","title":"Stap 8 - Documenteer, maak controleerbaar","description":"Leg vast hoe de uiteindelijk berekening tot stand is gekomen, welke data daarvoor gebruikt is, hoe je de data hebt verwerkt, welke filtering je hebt toegepast, wat de voor- en nadelen zijn van het gebruikte model."},"metamorphoses/metamorphoses_stap_9":{"id":"metamorphoses/metamorphoses_stap_9","title":"Stap 9 - Monitor KPI\u2019s","description":"Veel vraagstukken/problemen vereisen monitoring over een langere periode en zullen niet zijn beantwoord met een eenmalige analyse of conclusie."},"metamorphoses/metamorphoses_voorbeeld_klimaatadaptatie":{"id":"metamorphoses/metamorphoses_voorbeeld_klimaatadaptatie","title":"Klimaatadaptatie","description":"Klimaatadaptie is een belangrijk onderwerp met de huidige veranderingen in het milieu en de veranderingen die nog gaan komen in de toekomst. Wateroverlast hoort daar ook bij, maar denk ook aan hitte-eilanden, energieverbruik en -opwekking en luchtkwaliteit."},"metamorphoses/metamorphoses_voorbeeld_snuffelfiets":{"id":"metamorphoses/metamorphoses_voorbeeld_snuffelfiets","title":"Snuffelfiets","description":"Het snuffelfiets project is een initatief vanuit de provincie Utrecht om samen met burgers door middel van relatief goedkope sensoren een beeld te krijgen van de luchtkwaliteit in de provincie. Vaak is het onduidelijk hoe het nou staat met de luchtkwaliteit in een kwantitatieve manier en zijn de mogelijkheden om dit vast te stellen over het algemeen een flinke investering. Dit is een van veel voorkomende vicieuze cirkels, waarbij data nodig is om het probleem vast te stellen maar het probleem al duidelijk moet zijn om de juiste data te verzamelen."},"metamorphoses/metamorphoses_voorbeeld_template":{"id":"metamorphoses/metamorphoses_voorbeeld_template","title":"Voorbeeld template","description":"Dit is een praktisch voorbeeld waarbij getracht is zoveel mogelijk stappen uitgebreid te behandelen. Daardoor zal dit niet altijd een goed beeld geven van de werkelijkheid en is dus puur illustratief bedoeld."},"metamorphoses/metamorphoses_voorbeeld_wateroverlast":{"id":"metamorphoses/metamorphoses_voorbeeld_wateroverlast","title":"Wateroverlast","description":"Dit is een praktisch voorbeeld waarbij getracht is zoveel mogelijk stappen uitgebreid te behandelen. Daardoor zal dit niet altijd een goed beeld geven van de werkelijkheid en is dus puur illustratief bedoeld."},"slimbeheer/anonymous_email":{"id":"slimbeheer/anonymous_email","title":"anonymous_email","description":"How to set an anonymous email:"},"slimbeheer/Slimbeheer":{"id":"slimbeheer/Slimbeheer","title":"Slimbeheer","description":"Slimbeheer Intro"},"slimmelden/Slimmelden":{"id":"slimmelden/Slimmelden","title":"Slimmelden","description":"Slimmelden intro"},"slimmelden/slimmelden_updaten_data":{"id":"slimmelden/slimmelden_updaten_data","title":"Updaten dataset","description":"Stappenplan updaten Slim melden dataset:"},"template":{"id":"template","title":"Template & Formatting","description":"This is where you describe what it is that you\u2019ll accomplish on this page."},"Welcome":{"id":"Welcome","title":"Welcome","description":"Here you will find a central repository of all user documents pretaining to the City Innovation Platform.","sidebar":"docs"}}}')}}]);